import React from 'react'
import classes from "./Header.module.css"
function Header() {
  return (
    <>
        <header className={classes.header}>
            <h1>Wow Momos</h1>
            <button>Cart</button>
        </header>
        <div className={classes["main-image"]}>
            {/* <img></img> */}
        </div>
    </>
  )
}

export default Header
